<div class="GoogleActiveViewInnerContainer" style="left:0px;top:0px;width:100%;height:100%;position:fixed;pointer-events:none;z-index:-9999;"></div><style>{
    margin: 0;
    padding: 0;
}

html,
body {
    font-family: 'Poppins';
}

.hp-banner-wrapper {
    display: block;
    height: 60px;
    line-height: 60px;
    width: 100%;
}
.hp-banner-copy{
  padding-left:10px;
}
.hp-banner-gradient {
    display: block;
    height: 50px;
    line-height: 50px;
    position: relative;
    width: 100%;
    bottom: -10px;
    background: #000;
    background: -moz-linear-gradient(top, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.7) 100%);
    /* FF3.6-15 */
    background: -webkit-linear-gradient(top, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.7) 100%);
    /* Chrome10-25,Safari5.1-6 */
    background: linear-gradient(to bottom, rgba(0, 0, 0, 0) 0%, rgba(0, 0, 0, 0.7) 100%);
    /* W3C, IE10+, FF16+, Chrome26+, Opera12+, Safari7+ */
    filter: progid: DXImageTransform.Microsoft.gradient( startColorstr='#00000000', endColorstr='#000000', GradientType=0);
    /* IE6-9 */
}

.hp-banner {
    display: block;
    height: 50px;
    text-align: center;
    line-height: 50px;
    width: 100%;
    position: relative;
    font-size: 11px;
}

.hp-banner .inner {
    text-decoration: none;
    color: #fff;
    height: 100%;
    bottom: 0px;
    display: inline-flex;
    justify-content: center;
    align-items: flex-end;
    padding: 0 5px;
}

.hp-banner .inner img {
    max-width: 150px;
    position: relative;
    bottom: 9px;
    z-index: 1;
}

@media (min-width: 360px) {
    .hp-banner-gradient {
        bottom: -10px;
    }
    .hp-banner-wrapper {
        height: 60px;
        line-height: 60px;
    }
}

@media (min-width: 768px) {
    .hp-banner-wrapper {
        height: 100px;
        line-height: 100px;
    }
    .hp-banner-gradient,
    .hp-banner {
        height: 60px;
        line-height: 60px;
        font-size: 12px;
    }
    .hp-banner-gradient {
        bottom: -40px;
    }
    .hp-banner-cta {
        font-size: 12px;
    }
}

@media (min-width: 1024px) {
    .hp-banner-copy 
        a {
            font-size: 16px;
        }
    .hp-banner-cta {
        font-size: 14px;
    }
}

@media (max-width: 320px) {
	.hp-banner{
	height: 44px;
	line-height: 19px;
	}
}

.rules-text{
    font-size: 12px;
    color: #ffffff;
    margin-left: 0;
    position: relative;
    bottom: -2px;
    right: 4px;
    text-decoration: underline;
}
.rules-text a{
    font-size: 12px;
    color:#fff;
    padding:0;
    text-decoration: underline;
    font-weight: 400;
}
.hp-banner .inner .hp-banner-copy a {
    border: none;
    font-weight: 500;
    line-height: 50px;
    color: #2B2B2B;
    cursor: pointer;
    background: transparent;
    vertical-align: super;
    padding: 0;
    font-size: 18px;
    text-decoration: none;
    display: block;
    text-align: center;
    color: #ffffff;
    position: relative;
    bottom:5px; 
}
.hp-banner .inner .hp-banner-cta {
    border: 1px solid #d92228;
    color: #fff;
    line-height: 1.2;
    border-radius:25px;
    padding: 6px 6px 7px;
    cursor: pointer;
    max-width: 140px;
    vertical-align: middle;
    background-color:#d92228;
    font-size: 14px;
    width:120px;
    margin-left: 5px;
}

.hp-banner .hp-banner-cta:hover {
    background: #fff;
    border-color: #d92228;
    transition: 300ms linear;
    color: #d92228;
}
.inline-flex{
      display: inline-flex;
}
.inner a{
    text-decoration: none;
    padding-left: 10px;
}

@media (max-width: 768px) {
  .hp-banner .inner .hp-banner-cta{
    font-size: 11px;
    width: 86px;
    position: relative;
    bottom: 5px;
  }
  .hp-banner .inner img {
    bottom: -14px;
    width:100%;
  }
  .hp-banner{
    height: 44px;
    line-height: 15px;
  }
  .hp-banner .inner .hp-banner-copy{
    font-size: 11px;
    position: relative;
    bottom: 10px;
    text-align: center;
    display: flex;
  }
  .hp-banner .inner .hp-banner-copy a{
    text-align:center;
    top:15px;
    bottom:0;
  }
  .rules-text{
    font-size: 9px;
    bottom:10px;
    margin-left:0;
    right:2px;
    text-align: center;
    left: 0;
  }
  .rules-text a{
    font-size: 11px;
  }
}
